import React from "react";
import PropTypes from "prop-types";
import Featured from "./Featured";

const Title = props => {
  const labelStyle = {
    color: "white",
    fontWeight: "bold",
    fontSize: "1.8em",
    marginLeft: "4px"
  };
  const apiKey = "325d84ad33eb95a5c0fc5427ba3f569a";

  return (
    <div style={{ display: "flex", alignItems: "center" }}>
      <div
        style={{
          width: "4px",
          height: "28px",
          backgroundColor: "#c7493a"
        }}
      ></div>
      <label className="component-label" style={labelStyle}>
        {props.titleName}
      </label>
    </div>
  );
};

class Home extends React.Component {
  render() {
    return (
      <div className="home">
        <Featured apiKey={apiKey} />
      </div>
    );
  }
}

export default Home;
